Remarks:
Overpressure test1.The test is done to simulate ZME failed when system is running, this test is carried out with CRI1-16 injectors and CP1H fuel pump;
2.The testing boundary conditions are the same to the over pressure test of CRI1-14;
3.From the test result, the maximum over pressure of CRI1-16 is higher than CRI2-16 but lower than CRI1-14;
4.The maximum over pressure of CRI1-16 without EKP function is about 100bar-200bar higher than the one with EKP function

RPB investigation
1.The undershoot of system w/ FDB is larger than system w/ HFR, the overshoot and undershoot of system w/ FDB is not as stable as system w/ HFR when pump ability or system leakage changed;
2.The response times of system w FDB and w HFR are comparable;
3.System leakage and pump ability have more influence on system w/ FDB than w/ HFR, e.g. rail pressure stability, PID calibration
4.The influence on rail pressure from main injection is much larger than form pilot and post injection;
5.The influence on rail pressure of system w/ HFR is not as large as system w/ FDB ;
6.The influence on rail pressure of system w/ HFR is not as large as system w FDB when SOE modified;

Zero Delivery function verification
As backflow pressure of pump less than 1.33bar, the ZDT function of pump w/ 1.28bar suction valve and 1.42bar valve are comparable;
When backflow pressure is larger than 1.33bar, the ZDT function of pump w/ 1.28bar suction valve would take more time to be decreased to rail pressure setpoint;
When the pressure of backflow is 1.51bar, the rail pressure of pump with 1.28bar suction valve could not decreased to rail pressure setpoint and higher than 1200bar, the system would be shut off in the long overrun condition if the deviation of rail pressure is larger than setting value.

System tolerance investigation
The rail pressure sensing of system with EDC17C63 is approach to the limitation at full load point, and the one with EDC17C55 and EDC17C63 are comparable at other points;
The ECU power stage of system with EDC17C63 is larger than the one of system with ECU17C55, it is in the tolerance of CRS2-16;
The system tolerance of system with EDC17C55 and EDC17C63 are comparable except at full load point, but both of them are in the tolerance of CRS2-16;
The system tolerance of system with EDC17C55 and EDC17C63 are both a little out of the system tolerance of CRS2-16 at low idle point,  but they are acceptable considering the low injection quantity and accuracy of measuring device;

Over pressure test: The test is done to simulate ZME failed when system is running, this test is carried out with CRI1-16 injectors and CB18 fuel pump;
The testing boundary conditions are the same to the over pressure test of CRI1-14;
From the test result, the maximum over pressure of CRI1-16 is higher than CRI2-16 but lower than CRI1-14;
It’s could be found that the over pressure value would be changed as the ZME openning modified value, the same to the engine speed.

Rail pressure behavior:
1.The undershoot of system w/ FDB is larger than system w/ HFR, the overshoot and undershoot of system w/ FDB is not as stable as system w/ HFR when pump ability or system leakage changed;
2.The response times of system w FDB and w HFR are comparable;
3.System leakage and pump ability have more influence on system w/ FDB than w/ HFR, e.g. rail pressure stability, PID calibration
4.The influence on rail pressure from main injection is much larger than form pilot and post injection;
5.The influence on rail pressure of system w/ HFR is not as large as system w/ FDB ;
6.The influence on rail pressure of system w/ HFR is not as large as system w FDB when SOE modified;

Zero delivery function: 
As backflow pressure of pump less than 1.33bar, the ZDT function of pump w/ 1.28bar suction valve and 1.42bar valve are comparable;
As backflow pressure of pump increasing,  when backflow pressure is 1.43bar, the ZDT function of pump w/ 1.28bar suction valve is more critical;
For the backflow pressure of pump should be less than 1.2 bar (abs.) in the TCD of CB08 , the pump w/ 1.28bar suction valve would not influence the ZDT function of CB08;

System tolerance investigation:
The rail pressure sensing of system with EDC17C63 is approach to the limitation at full load point, and the one with EDC17C55 and EDC17C63 are comparable at other points;
The ECU power stage of system with EDC17C63 is larger than the one of system with ECU17C55, it is in the tolerance of CRS2-16;
The system tolerance of system with EDC17C55 and EDC17C63 are comparable except at full load point, but both of them are in the tolerance of CRS2-16;
The system tolerance of system with EDC17C55 and EDC17C63 are both a little out of the system tolerance of CRS2-16 at low idle point,  but they are acceptable considering the low injection quantity and accuracy of measuring device;
